/**********************************************************************************************
 * 1) 公元前723年, 10个月, 无十一月和十二月
 * 2) 春秋历(公元前722年 – 前481年)没有固定的置闰法则，正月的月建并不固定，而是在建亥(即现在的十月)与建寅(现在的正月)之间摆动。
 *    春秋初期的正月月建多在建丑(现在的十二月)，末期则多在建子(现在的十一月)。目前学界对于春秋历的闰月的位置末有一致意见。
 * 3) 战国时代(约公元前480年 - 前222年)各国施行不同历法，当时使用的历法有六种:周历、鲁历、殷历、夏历、黄帝历和颛顼历，合称「古六历」。
 *    六种历法的计算方法大致相同，但各历的年首不尽相同，用以计算历法的历元也不同。
 * 4) 对春秋战国时期(公元前722年 – 前222年), 这里假设闰月置于年终，不注明闰几月。
 * 5) 秦朝及汉初(公元前221年 – 前104年)的历法沿用颛顼历的月序。颛顼历是古六历之一，据说战国后期在秦国使用。
 *    颛顼历以建亥(即今天的十月)为年首，但仍称建亥为十月。月的数序是十月、十一月、十二月、正月、二月……九月，闰月置于年终，称为后九月。
 * 6) 公元9年，王莽建立新朝，改正朔以殷正建丑(即现在的十二月)为年首，故公元8年的农历年(戊辰年)只有十一个月。
 *    农历月的数序是:建丑为正月、建寅为二月等等，与现在通用的月序相差一个月。新朝于地皇四年(癸未年，公元23年)亡，
 *    绿林军拥立汉淮南王刘玄为帝，改元更始元年，恢复以建寅(即现在的正月)为年首。地皇四年和更始元年有十一个月重叠。
 *    地皇四年用丑正、更始元年用寅正，所以地皇四年二至十二月相当于更始元年正至十一月。
 * 7) 魏青龙五年（丁巳年，公元237年），魏明帝改正朔，以殷正建丑(即现在的十二月)为年首，二月后实施，并改元景初元年。
 *    所以丁巳年没有三月份，二月后的月份是四月。农历月的数序是:建丑为正月、建寅为二月等等，与现在通用的月序相差一个月。
 *    景初三年（公元239年）明帝驾崩,次年恢复以建寅(即现在的正月)为年首。景初三年有两个十二月。
 * 8) 公元689年12月，武则天改正朔，以周正建子(即现在的十一月)为年首，建子改称正月，建寅（即现在的正月）改称一月，
 *    其他农历月的数序不变（即正月、十二月、一月、二月__十月）。公元701年2月又改回以建寅为年首。
 *    公元689年的农历年(己丑年)只有十一个月(其中一个月是闰月)，而公元700年的农历年(庚子年)有十五个月(其中一个月是闰月)
 * 9) 公元761年12月，唐肃宗改正朔，以周正建子(即现在的十一月)为年首，建子改称正月、建丑（即现在的十二月）改称二月、
 *    建寅（即现在的正月）改称三月等等，与现在通用的月序相差二个月。公元762年4月又把农历月的数序改回以建寅为正月、建卯为二月等。
 *    公元761年的农历年（辛丑年）只有十个月, 而公元762年的农历年（壬寅年）则有十四个月，其中有两个四月和两个五月。
 **********************************************************************************************/


